import React from 'react';
import './Rightbar.css';

const Rightbar = () => {
  return (
    <div className='right-bar'>
        <div className='r-b-user'>
             Aman Thakur
        </div>
        <div className='r-b-options'>
           <div className='r-b-item'>
              <span>Setting</span>
           </div>
           <div className='r-b-item'> 
              <span>Logout</span>
           </div>

        </div>
    </div>
  )
}

export default Rightbar
